import './App.css';
import Header from './components/Header';
import AddStudent from './components/AddStudent'
import {BrowserRouter , Router, Route} from "react-router-dom"

function App() {
  return (
    <BrowserRouter>

    <Router>
      <div >
        <Header/>

        <Route path="/add" exact component={AddStudent} />

      </div>
    </Router>
    </BrowserRouter>
  );
}

export default App;
